import React from "react";
import "./styles.scss";
import strings from "../../en-NZ";
import ContentBlock from "../../components/ContentBlock/ContentBlock";
import cn from "classnames";
import SkillsGraph from "../../components/SkillsGraph/SkillsGraph";

const content = [strings.about.iam, strings.about.recent, strings.about.self];

const content2 = [strings.about.check];

const AboutSection = () => {
  return (
    <div className="about">
      <ContentBlock
        id="about-content"
        title={strings.about.title}
        content={content}
      />
      <SkillsGraph />
      <ContentBlock
        content={content}
      />
    </div>
  );
};

export default AboutSection;
